import React from 'react';
import styled from 'styled-components';

const Colomn = styled.div`
	display: flex;
	flex-direction: row;
`;

type ColProps = {
	children: any;
	direction: "initial" | "inherit" | "row" | "row-reversed" | "col" | "col-reversed";
	align: "center" | "between" | "around" | "start" | "end";
	justify: "center" | "between" | "around" | "start" | "end";
}

const Col = (props: ColProps) => <Colomn >{props.children}</Colomn>

export default Col;
